import React, { Component } from "react";
import "./App.css";
import Nav from "./components/Nav";
import HogBrowser from './components/HogBrowser'; 


const mugshots = {
  "Mudblood": mudblood,
  "Porkchop": porkchop,
  "Cherub": cherub,
  "Piggy smalls": piggy_smalls,
  "Trouble": trouble,
  "Sobriety": sobriety,
  "Rainbowdash": rainbowdash,
  "TruffleShuffle": truffleshuffle,
  "Bay of Pigs": bay_of_pigs,
  "The Prosciutto Concern": the_prosciutto_concern,
  "Galaxy Note": galaxy_note, 
  "Leggo My Eggo": leggo_my_eggo,
  "Augustus Gloop": augustus_gloop
}

class App extends Component {
  state ={
    hogs:[],
  }

  render() {
    return (
      <div className="App">
        <Nav />
        <HogBrowser piggies={this.state.hogs}/>
      </div>
    );
  }

  componentDidMount(){
    fetch('http://localhost:3000/hogs')
    .then(resp => resp.json())
    .then(data =>{
      this.setState({ hogs: data});
    })
  }
}

export default App;
